contracts/userRegistration.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

contract UserRegistration {
    enum UserType { Learner, Instuctor }

    struct User {
        address walletAddress;
        UserType userType;
        bool isRegistered;
    }

    mapping(address => User) public users;

    event UserRegistered(address indexed walletAddress, UserType usertype);

    function register(UserType _usertype) external {
        require(!users[msg.sender].isRegistered, "user already registered");

        users[msg.sender] = User({
            walletAddress: msg.sender,
            userType: _usertype,
            isRegistered: true
        });

        emit UserRegistered(msg.sender, _usertype);
    }
}

